In C, you can terminate a program using the `exit()` function or the `return` statement in the `main()` function.

The `exit()` function causes the immediate termination of the current process and any child processes, and any open files are closed. The `exit()` function takes an integer argument, which is the exit status of the program.

Here is an example of using `exit()` to terminate a program:
```
#include <stdlib.h>

int main() {
    // Your code here
    exit(0);
}
```

The `return` statement in the `main()` function also causes the program to terminate, but it does not close any open files. The return value of the `main()` function is the exit status of the program.

Here is an example of using the `return` statement to terminate a program:
```
#include <stdio.h>

int main() {
    // Your code here
    return 0;
}
```

It is also possible to terminate a program using the `abort()` function, which causes the program to terminate immediately and print an error message to the standard error stream. The `abort()` function does not return a value, so it is not suitable for use in a program that needs to return an exit status.

Here is an example of using `abort()` to terminate a program:
```
#include <stdlib.h>

int main() {
    // Your code here
    abort();
}
```
